С помощью мобильного приложения «Социальный навигатор» Вы сможете:
 
- посмотреть информацию о своем больничном и отследить его статус;
- подать обращение в Фонд и узнать статус его рассмотрения;
- записаться на прием в Фонд для получения услуги;
- заказать справки о выплатах и 2-НДФЛ;
- отследить ход предоставления пособий и выплат;
- посмотреть сведения о программах реабилитации;
- рассчитать сумму компенсации за самостоятельно приобретенное ТСР;
- найти адреса ближайших отделений Фонда, точек приема ЭС ТСР и других социально значимых объектов;
рассчитать размер выплат (с учетом региональных особенностей): от пособия по временной нетрудоспособности до декретных выплат;
посмотреть сведения о родовом сертификате;
- ознакомиться с перечнем необходимых документов для получения услуг.
 
Также в мобильном приложении можно ознакомиться с информацией о текущей деятельности, проектах развития и новостях Фонда социального страхования РФ.
 
Внимание! Для получения доступа к некоторым сервисам, предоставляемым через приложение, необходимо иметь подтверждённую учётную запись на Едином портале государственных и муниципальных услуг (gosuslugi.ru) в Единой системе идентификации и аутентификации (ЕСИА).

